import React from 'react';

import styled from 'styled-components';

import { ViewerSettingItemStyle } from '../../styles/viewer';

const Container = styled.div`
  ${ViewerSettingItemStyle}
`;

interface Props {
  label: string;
  value: number | string;
}

const ViewerSettingColor: React.FunctionComponent<Props> = ({ label, value }) => {
  return (
    <Container>
      {label}
      {value}
    </Container>
  )
};

export default ViewerSettingColor;
